import React from "react";
import ContentList from "./footerContentList";
import SectionWithImg from "./sectionWithImage";
import SocialMediaIcons from "./socialIcons.jsx";

function Footer() {
  return (
    <div className="bg-dark text-white py-5">
      <div className="container-md d-md-flex justify-content-between">
        <div>
          <img src="" alt="OYTechnology Pvt. Ltd." />
          <p className="m-0">
            <SocialMediaIcons sMedia="house" />
            83/57, Sector 8, Pratap Nagar
          </p>
          <p>Jaipur, Rajasthan - 302033</p>
          <p>
            <SocialMediaIcons sMedia="telephone" />
            +91-8285524418
          </p>
        </div>
        <SectionWithImg
          heading="Latest News"
          text={`"There is no one who loves pain itself"`}
        />
        <ContentList
          heading="Content"
          content={["Home", "About Us", "Services", "Career"]}
          links={["/", "/aboutUs", "/ourServices"]}
        />
        <ContentList
          heading="Content"
          content={["Home", "About Us", "Services", "Career"]}
          links={["/", "/aboutUs", "/ourServices"]}
        />
        <ContentList
          heading="Content"
          content={["Home", "About Us", "Services", "Career"]}
          links={["/", "/aboutUs", "/ourServices"]}
        />
      </div>
    </div>
  );
}

export default Footer;
